import React, { Component, Fragment} from 'react';

class ImgPreview extends Component {
    constructor(props){
      super(props);
      this.state={
        imgData: this.props.imgData,
        linksText: this.prop,
        elemChange:this.props.elemChange,
        jsonValue : this.props.jsonValue,
        isChecked : this.props
      };
    }

    render() {
      let url = '';
      const domain = () => {
        switch(this.props.brandName){
          case 'Gap':
            url = `https://www.gol.wip.gidapps.com/`;
          break;
          case 'Old Navy':
              url = `https://www.onol.wip.gidapps.com/`;
          break;
          case 'Banana Republic':
            url = `https://www.brol.wip.gidapps.com`;
          break;
          case 'Athleta':
            url = `https://www.atol.wip.gidapps.com`;
          break;
          default:
            url = `https://www.gol.wip.gidapps.com/`;
        }
      };
      console.log(domain());
      console.log(url);
      const smallSvg = `${url}${this.state.imgData.data.svgoverlay.smallImg}`;
      const largeSvg = `${url}${this.state.imgData.data.svgoverlay.largeImg}`;
      const smallImg = `${url}${this.state.imgData.data.background.content.smallImg}`;
      const largeImg = `${url}${this.state.imgData.data.background.content.largeImg}`;

      return (
        <Fragment>
          <div style={{"visibility":`${this.props.visibility}`}}>

            <div className="imgPreview" >
              <div className="mkt-image">
                <picture>
                  <source media="(max-width:767px)" srcSet={smallImg} />
                    <img alt={this.state.imgData.data.background.altText} src={largeImg}/>
                  </picture>
                </div>
                <div className="absolute leftTop">
                  <picture>
                    <source media="(max-width: 767px)" srcSet={smallSvg}/>
                    <img src={largeSvg} alt={this.state.imgData.data.svgoverlay.altText}/>
                  </picture>
                </div>
              </div>
            </div>
          </Fragment>

        );
      }
  }

  export default ImgPreview;
